Most components have parameters, and they're named. For example, in the components below, we pass href by name. However, the last parameter in a function definition can be supplied without a name as the last parameter in a call. For Text, that's the text parameter, which takes a value that implements ToString. For every other avalanche_web component, the unnamed last parameter is children, which takes an Into<Vec<View>>. Below are two versions of a link component. One passes text and children explicitly, while the other does it implicitly, as is idiomatic. use avalanche::{component, View};
use avalanche_web::components::{A, Text}; const FIRST_SITE: &str = "http://info.cern.ch/hypertext/WWW/TheProject.html"; #[component]
fn LinkExplicit() -> View { A!( href: FIRST_SITE, children: [ Text!(text: "The first website") ] )
} #[component]
fn LinkImplicit() -> View { A!( href: FIRST_SITE, [ Text!("The first website") ] )
} For avalanche_web components, it's generally recommended to use implicit last parameters, so we'll be using them from now on in this tutorial. In third-party components, by convention, you should only use them if there is only one parameter, like in Text, or if the last parameter is a child or children of the component.

