So far, we've dealt only with components with hard-coded data. However, within most practical components, we want to allow other components to pass them data. To enable that, you simply need to add parameters to your component function. Here, let's say we want a reusable Link with its own custom functionality, and want to allow a custom destination and text to be specified. We can add to and text parameters: use avalanche::{component, tracked, View};
use avalanche_web::components::{A, Text}; #[component]
fn Link(to: String, text: String) -> View { A!( href: tracked!(to), [ Text!(tracked!(text)) ] )
} Notice that for the href and implicit text parameters, we pass tracked! parameters instead of just passing them by value. That's because when we say a parameter is, for example, a String, we actually receive a Tracked<String>. A Tracked value wraps an inner value with data on whether it's been updated since last render. avalanche uses this to allow for efficient re-rendering of components. Calling tracked! on a Tracked value gives us its inner value. Since Text and A expect String-like values, but the to and text parameters are Tracked<String>, we use tracked!() to get String values. We can then construct Link inside of other components: use avalanche::{component, tracked, View};
use avalanche_web::components::{Text, Div};
# use avalanche_web::components::A;
# # #[component]
# fn Link(to: String, text: String) -> View {
# A!(
# href: tracked!(to),
# [
# Text!(tracked!(text))
# ]
# )
# } #[component]
fn Example() -> View { Div!([ Link!( to: "https://example.com".into(), text: "example.com".into() ), Text!(" is a domain reserved for use in demos.") ])
} When rendered, the above is equivalent to the HTML below. <div> <a href="https://example.com"> example.com </a> &nbsp;is a domain reserved for use in demos.
</div> Within component calls, parameter order does not matter, so we could've also called Link! with to and text swapped: Link!( text: "example.com".into(), to: "https://example.com".into()
)

