Want to render something only if a condition is true? Use an if statement: # use avalanche::{component, tracked, View};
# use avalanche_web::components::Text;
#
#[component]
fn Conditional(cond: bool) -> View { if tracked!(cond) { Text!("True!") } else { ().into() }
} From this point, we'll be omitting previously used avalanche and avalanche_web imports for brevity. The () type is a special Component that renders nothing. We call .into() on it to turn it into a View. There is also a shorthand for this some component-or-nothing case: # use avalanche::{component, tracked, View};
# use avalanche_web::components::Text;
#
#[component]
fn Conditional(cond: bool) -> View { tracked!(cond).then(|| Text!("True!")).into()
} That's equivalent to the above example. This uses bool's then method . Option<View> is also a special component, rendering the View in its Some case and rendering nothing in its None case. Of course, if you want more complex conditionals, you can use other control flow like else if and match.

