The tracked system relies on purity , or the idea that a component's output should only be the result of its input parameters. Not doing that will lead to some issues. Take this first naive, impure attempt at introducing a random number to a component, using the rand crate's random function, which uses thread-local state in its implementation. Here, we'll try to show a random number, and generate a new one every time we click a button. # use avalanche::{component, state, View};
# use avalanche_web::components::{Text, Div, Button};
use rand::random; #[component]
fn Random() -> View { let (_, trigger_update) = state(self, || ()); Div!( [ Button!( on_click: move |_| trigger_update.set(()), [ Text!("Generate new number") ], ), Div!([ Text!(random::<u16>()) ]) ] )
} However, if you try out the example for yourself, you'll notice that the number doesn't actually update. A reasonable explanation for this would be we're not actually modifying trigger_update's state, or that its current value is equal to the previous one. However, calling a state setter always triggers a component rerender. Rather, the reason is that random::<u16>() is not Tracked, so it's considered a constant. This leads to an important rule: a component's parameter will only update if it has a tracked!() call with an updated Tracked value. Text!(random::<u16>()) doesn't have a tracked!() call, so it will never update. The issue here is that random is an impure function, but avalanche doesn't know that. The solution is to use hooks to introduce impurity, like we did with the counter example. # use avalanche::{component, tracked, state, View};
# use avalanche_web::components::{Text, Div, Button};
use rand::random; #[component]
fn Random() -> View { let (value, set_value) = state(self, || random::<u16>()); Div!( [ Button!( on_click: move |_| set_value.set(random()), [ Text!("Generate new number") ] ), Div!([ Text!(tracked!(value)) ]) ] )
} Now, text clearly depends on the value state, so when we call set_value, avalanche will update that text value on screen. Using hooks introduces impurity in a manner avalanche can understand.

