Mutable variables make the tracked system leaky. Consider this snippet of code: let (value, _) = state(self, || 5);
let mut mutable = 2;
mutable += *tracked!(value); Since mutable isn't tracked, but its value depends on a Tracked value, using it as a component parameter will cause unexpected failures to update UI appearance. Instead, prefer creating new variables.

