Rendering more heavily dynamic content is where the tracked system shines. But first, a pitfall: here's a potential first attempt at rendering a list of dynamic children: # use avalanche::{component, tracked, state, View};
# use avalanche_web::components::{Ul, Li, Text};
#
#[component]
fn List() -> View { let (items, update_items) = state(self, || vec![String::from("a")]); Ul!( tracked!(items).iter().map(|item| Li!( key: item, [Text!(item)] )).collect::<Vec<_>>() )
} Here, we use the standard iterator methods map and collect to turn a Vec of strings into a Vec of Views. However, notice that in the component Text!(item), the implicit text parameter has no tracked! call, so if we later update the element "a", for example, that change won't be appropriately rendered. We can change that with the vec hook, which allows tracking individual elements of a Vec. vec takes in self and a closure that returns a default value of type std::vec::Vec. It returns a Tracked<&avalanche::tracked::Vec> and a special vec setter, both of which enable individual elements to be tracked for updates. # use avalanche::{component, tracked, View};
# use avalanche_web::components::{Ul, Li, Text};
use avalanche::vec; #[component]
fn List(items: Vec<String>) -> View { let (items, update_items) = vec(self, || vec![String::from("a")]); Ul!( tracked!(items).iter().map(|item| Li!( key: tracked!(item), [Text!(tracked!(item))] )).collect::<Vec<_>>() )
} Now the iter method on items returns elements of type Tracked<&String> rather than &String.

