One case where events are useful is with input elements. That's because the TypedEvent type gives access to the current_target() method, which provides a reference to the component's associated native reference. We can use this to keep track of an Input element's state: # use avalanche::{component, tracked, state, View};
use avalanche_web::components::Input; #[component]
fn ControlledInput() -> View { let (text, set_text) = state(self, || String::new()); Input!( value: tracked!(text).clone(), on_input: move |e| set_text.set(e.current_target().unwrap().value()) )
} In this example, text holds the input's current contents, allowing us to use it for other purposes. In React, programmers often use on_change instead of on_input, but React semantics do not match native browser ones in this case; use on_input in avalanche_web instead. For a more complex example of how state and events work in avalanche, check out the todomvc example.

