To create an avalanche_web app, first run the command npm init rust-webpack my-app-name, where my-app-name is the name of the application you want to create. This will create a directory with name my-app-name. Your Rust code will live within its /src directory. Within src/lib.rs, you will see some helpful preloaded setup, including a panic hook for debugging messages, and the main_js function. To get a minimal avalanche_web app off the ground, first we need to add some dependencies. In the Cargo.toml file, add the following dependencies: avalanche = "^0.1.0"
avalanche_web = "^0.1.0" Next, add this code somewhere outside the main_js function: use avalanche::{component, View};
use avalanche_web::components::{H1, Text}; #[component]
fn HelloWorld() -> View { H1!([ Text!("Hello world!") ])
} Finally, add this call in main_js: # use avalanche::{component, View};
# use avalanche_web::components::{H1, Text};
# # #[component]
# fn HelloWorld() -> View {
# H1!([
# Text!("Hello world!")
# ])
# }
# fn dont_run() {
avalanche_web::mount_to_body::<HelloWorld>();
# } Now, to see your app, run npm start within the my_app_name directory. If you haven't gotten any compiler errors, you should see your first avalanche and avalanche_web web!
